import { Link, NavLink } from "react-router-dom";

export default function Navbar() {
  const link = "px-4 py-2 rounded hover:bg-gray-100";
  const active = "bg-gray-200";

  return (
    <header className="w-full border-b bg-white">
      <nav className="max-w-5xl mx-auto flex items-center justify-between p-4">
        <Link to="/" className="text-xl font-bold">MediQ</Link>
        <div className="flex gap-2">
          <NavLink to="/medicines" className={({isActive}) => `${link} ${isActive?active:""}`}>Medicines</NavLink>
          <NavLink to="/upload" className={({isActive}) => `${link} ${isActive?active:""}`}>Upload Prescription</NavLink>
          <NavLink to="/approved" className={({isActive}) => `${link} ${isActive?active:""}`}>Approved & Buy</NavLink>
        </div>
      </nav>
    </header>
  );
}
